import { AppRegistry, Platform } from 'react-native';
import App from './App';
import FontAwesome from './assets/fonts/FontAwesome';
import FontAwesome5_Brands from './assets/fonts/FontAwesome5_Brands';
import FontAwesome5_Regular from './assets/fonts/FontAwesome5_Regular';
import FontAwesome5_Solid from './assets/fonts/FontAwesome5_Solid';


if (Platform.OS === 'web') {
    const iconFontStyles =
        `@font-face { src: url(${FontAwesome}); font-family: serif_Bold; font-weight:bolder; }
         @font-face { src: url(${Serif_Regular}); font-family: Serif_Regular;}`

         const style = document.createElement('style');
    if (style.styleSheet) {
        style.styleSheet.cssText = iconFontStyles;
    } else { style.appendChild(document.createTextNode(iconFontStyles)); }
    document.head.appendChild(style);

    const { registerRootComponent } = require('expo')
    registerRootComponent(App)
}
else {
    AppRegistry.registerComponent('mixprj', () => App)
}
